import React from "react";
import { useHistory } from "react-router-dom";
import { apiCreateChannel } from "../../utils/api_users"

const http = require("http")
const url = require('url')
const qs = require('querystring')

const Home = (props) => {
    const user = (qs.parse(url.parse(window.location.href).query)['id'])

    const { register, handleSubmit, errors } = useForm()
    let history = useHistory()

    const logOut = () => {
        history.push('/');
    }

    const onSubmit = (data) => {
        apiCreateChannel(data.username,
            (erreur) => {
                console.log(erreur)
            })
    }

    return (
        <div className="base-container" >
            <div className="header">Bienvenue retour, {user} !</div>
            <div className="content">
            </div>
            <div className="footer" onSubmit={handleSubmit(onSubmit)}>
              <button type="submit" className="btn">
                Create a channel
              </button>
            </div>
            <div className="log-out-button">
                <span className="register-message" onClick={() => logOut()}>Log Out</span>
            </div>
        </div>
    )
}


export default Home;
